contracts/StorageFactoru.sol.content:
//SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import "./SimpleStorage.sol";

contract StorageFactory is SimpleStorage{

    SimpleStorage[] public simpleStorageArray;

    function createSimpleStorageContract() public{
        SimpleStorage simpleStorage = new SimpleStorage();
        simpleStorageArray.push(simpleStorage);
    }

    function sf_Store(uint256 _simpleStorageIndex, uint256 _simpleStorageNumber) public{
        SimpleStorage simpleStorage = SimpleStorage(address(simpleStorageArray[_simpleStorageIndex]));
        simpleStorage.store(_simpleStorageNumber);
    }

    function sf_retrieve(uint256 _simpleStorageIndex) public view returns(uint256){
        return SimpleStorage(address(simpleStorageArray[_simpleStorageIndex])).retrieve_aNumber();   
    }

}

contracts/SimpleStorage.sol.content:
//SPDX-License-Identifier: MIT

pragma solidity >=0.6.0 <0.9.0;


contract SimpleStorage{

    struct People {
        string name;
        uint256 favoriteNumber;
    }


    function store(uint256  _aNumber) public{
        aNumber =  _aNumber;
    }

    function retrieve_aNumber() public view returns(uint256){
        return aNumber;
    }

    function addPerson(string memory name, uint256 _num) public {
        people.push(People(name, _num));
        nameToFavorite[name] = _num;
    }

    uint256 public aNumber;

    People[] public people;

    mapping(string => uint256) public nameToFavorite;

}
